import React from 'react'
import allblog from '../blogdata/blog.json'

const AllPosts = () => {
    //console.log(allblog)
    return (
        <div>
            {
                allblog.data.map((items, i) => {
                    return (
                        <>
                            {items.blogTitle}
                            <img src={items.blogImage} alt="" srcset="" />
                        </>
                    )
                })
            }
        </div>
    )
}

export default AllPosts
